import {Table, FormControl } from 'react-bootstrap';
import {React} from 'react';
import Row from './rows';
const object=[<tr>
    <td> <Form.Control type="text" placeholder="text" /></td>
    <td>Otto</td>
    <td>@mdo</td>
    </tr>]
const app =() =>{
return(    
    <Table striped bordered hover>
    <thead>
      <tr>
        <th>First Name</th>
        <th>Last Name</th>
        <th>Username</th>
        <th>#</th>
      </tr>
    </thead>
    <tbody>
    <Row object={object}/>
</tbody>
  </Table>
        
     
    );
}

export default app;
